import { Button, List } from 'antd';
import React, { FC } from 'react';

interface ConnectionListProps {
  title: string;
}

export const ConnectionList: FC<ConnectionListProps> = ({ title }) => {
  return (
    <List
      header={title}
      style={{
        marginBottom: 20,
      }}
      grid={{
        gutter: 4,
        xs: 2,
        md: 3,
      }}
      size='small'
      loadMore={
        <div>
          <Button>More..</Button>
        </div>
      }
    />
  );
};

export default null;
